/*
 *  You are given a string, S, and a list of words, L, that are all of the same length.
 *  Find all starting indices of substring(s) in S that is a concatenation of each word in L
 *  exactly once and without any intervening characters.
 *  
 *  For example, given:
 *    S: "barfoothefoobarman"
 *    L: ["foo", "bar"]
 *  
 *  You should return the indices: [0,9].
 *  (order does not matter).
 */
vector<int> find(const string& s, const vector<string>& words) {
  int slen = s.length();
  int wordlen = words[0].length();
  int numwords = words.size();
  int totallen = wordlen * numwords;
  vector<int> result;

  if(slen < numwords) return result;

  unordered_map<string, int> wordCount;
  for(auto s : words) wordCount[s]++;

  for(int i = 0; i < slen - totallen + 1; ++i) {
    unordered_map<string, int> unused(wordCount);

    for(int j = i; j != i + totallen; j += wordlen) {
      string curr = s.substr(j, wordlen);
      if(!unused.count(curr) || unused[curr] == 0) break;

      if(--unused[curr] == 0) unused.erase(curr);
    }
    if(unused.size() == 0) result.push_back(i);
  }
  return result;
}

